    "Nestucca Bay - Coastal Prairie and Oregon Silverspot Butterfly Habitat Restoration
    2013",nt"tracking_summary": {ntt"total": 6,ntt"recent": 1nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2016-08-20T09:39:37.282053",nt"name":
    "nestucca-bay-coastal-prairie-and-oregon-silverspot-butterfly-habitat-restoration",nt"isopen":
    false,nt"url": null,nt"notes": "The Service is partnering with the Institute
    for Applied Ecology (IAE) and several dedicated volunteer groups to convert 30 acres
    at Nestucca Bay NWR from highly aggressive, nonnative pasture grasses and other
    invasive plants to native coastal grasses and forbs with an emphasis on the species
    and structure required for all life stages of the threatened Oregon silverspot butterfly.
    The refuge coastal prairie, once restored through invasive plant removal and replanting,
    will provide a permanently protected refugia site for establishing another OSB population.
    It is imperative that permanently protected, high quality habitat be established
    as quickly as possible so that the butterfly does not continue its descent toward
    extinction. The refuge coastal prairie, once restored through invasive plant removal
    and replanting with specific native plants, will provide this permanently protected
    site. Volunteers provide essential labor for the mechanical removal of invasive
    species, monitoring results and success, and planting plugs and seeding once invasive
    plants are controlled.",nt"license_title": "License Not Specified",nt"extras":
